// React
import React, { Component, Fragment } from "react";

// Third part
import { Layout, Menu, Typography } from "antd";
import { HashRouter as Router, Route, Link } from "react-router-dom";

// Custom
import "../../assets/css/EmployeeForm.css";

const { Header, Content, Footer } = Layout;

const { Text } = Typography;

export default class EmployeeBoard extends Component {
  render() {
    return (
      <Fragment>
        <Router>
          <Layout>
            <Header
              style={{
                position: "fixed",
                zIndex: 1,
                width: "100%",
                background: "#000000",
                display: "flex"
              }}
            >
              <Menu
                theme="dark"
                mode="horizontal"
                defaultSelectedKeys={["1"]}
                style={{ lineHeight: "64px" }}
              >
                <Menu.Item disabled>
                  <Text className="brand" type="warning">
                    PLOV
                  </Text>
                </Menu.Item>
                <Menu.Item key="1">Personal</Menu.Item>
                <Menu.Item key="2">Ored</Menu.Item>
                <Menu.Item key="3">Reservaton</Menu.Item>
              </Menu>
            </Header>
            <Content style={{ padding: "0 50px", marginTop: 94 }}>
              <div style={{ background: "#fff", padding: 24, minHeight: 380 }}>
                Content
              </div>
            </Content>
            <Footer style={{ textAlign: "center" }}>
              Ant Design ©2018 Created by Ant UED
            </Footer>
          </Layout>
        </Router>
      </Fragment>
    );
  }
}
